"""# Implementation of Breadth First Search (BFS)

<p style="text-align: justify"> <b>Generated</b> is a set of states which has been generated, because once weve reached a state, we can never find a better path to the state. That also means we can do an <b>early goal test</b>, checking whether a node is a solution as soon as it is generated, rather than the late goal test that best-first search uses, waiting until a node is popped off (selected for expansion) the queue.</p>
<b>Expanded</b> is a set of states which has been <b>selected</b> from the <b>generated</b> list and then expanded.
"""

def bfs(start, goal, G):
    # by default the expanded list is empty
    expanded= []

    # we don't store only node names rather the paths to the nodes and path costs are also stored
    queue = [([start], 0)]

    # repeat untill the goal test satisfied or the queue becomes empty
    while len(queue) > 0:
        print('\nList of paths in the Queue:')
        for node in queue: print(node[0])

        # selceting the node
        unode  = queue.pop(0)
        u = unode[0][-1]

        # expand u
        print(f"\n\nExpanding the path: {unode[0]}")
        expanded.append(u)
        for v in G[u].keys(): # ['Sibiu', 'Zerind', 'Timisoara']
            # process if v is not EXPANDED yet
            if v not in expanded:

              print(f"<{v}> generated! ", end='')
              newPath = unode[0]+[v]
              newCost = unode[1] + G[u][v] #remember the formula g(n')=g(n)+c(n,n')

              # goal test
              if v == goal:
                print('Goal test satisfied.')
                return newPath,newCost # breaking from while

              # if v is not a goal node insert in queue
              queue.append((newPath,newCost))# store the generated node in the frontier

    print('Failed')

bfs('Arad', 'Bucharest', romanian_map) # change the soure and destination

