# modify the code of BFS to inplement DFS
# there will be 3 changes:
# 1) instead of queue a stack will be used
# 2) goal test will be performed for selected node before expanding

def dfs(start, goal, G):
    # by default the expanded list is empty
    expanded = []

    # We don't store only node names but the paths to the nodes and path costs
    stack = [([start], 0)]  # Stack stores (path, path_cost)

    # Repeat until the stack is empty
    while len(stack) > 0:
        print('\nList of paths in the Stack:')
        for node in stack:
            print(node[0])

        # Select the node (last node in the stack)
        unode = stack.pop()
        u = unode[0][-1]

        # Goal test before expanding
        if u == goal:
            print(f"\nGoal test satisfied with path: {unode[0]}")
            return unode[0], unode[1]  # Return the path and the cost

        if u in expanded:
            continue

        # Expand u
        print(f"\nExpanding the path: {unode[0]}")
        expanded.append(u)
        for v in G[u].keys():  # Iterate over neighbors of u
            # Process if v is not expanded yet
            if v not in expanded:
                print(f"<{v}> generated! ", end='')
                newPath = unode[0] + [v]
                newCost = unode[1] + G[u][v]  # g(n') = g(n) + c(n, n')

                # Insert v into the stack (DFS)
                stack.append((newPath, newCost))

    print('Failed to find goal')
    return None, None

